import React from 'react';
import useMediaQuery from '@material-ui/core/useMediaQuery';

export default function SimpleMediaQuery() {
  const matches = useMediaQuery('(min-width:1900px)');
  

  return <span>
      
      {`(min-width:1900px) matches: ${matches}`}
  
  </span>;
}
